steps.onInit:
scenario.totalQuestionsAsked = 0;
scenario.messageText = session.message.text;
scenario.luis = {};
var locationCity = null;
var locationCountry = null;
scenario.notMapped = [];
if(scenario.scenarioArgs.entities != null) {
    // iterate all LUIS entities and set their values to scenario
    scenario.scenarioArgs.entities.forEach(ent => {
        switch(ent.type) {
                case "gender":
                    scenario.luis.gender = ent.role;
                    break;
                case "builtin.age":
                    scenario.luis.age = ent.resolution.value;
                    break;
                case "disease":
                    scenario.luis.condition = scenario.messageText.substring(ent.startIndex, ent.endIndex + 1);
                    break;
                case "builtin.geographyV2.city":
                    locationCity = ent.entity;
                    break;
                case "builtin.geographyV2.countryRegion":
                    locationCountry = ent.entity;
                    break;
                case "builtin.geographyV2.state":
                    locationCountry = ent.entity;
                    break;
                default:
                    scenario.notMapped.push(ent.entity);
            }
    });
}
// one of location types was initialized
if(locationCity != null || locationCountry != null) {
    scenario.luis.location = { 
        city: "",
        country: ""
    };
    if(locationCity != null) {
        scenario.luis.location.city = locationCity;
    }
    if(locationCountry != null) {
        scenario.luis.location.country = locationCountry;
    }
};

// gender 
if (scenario.luis.gender != null) {
    scenario.gender = scenario.luis.gender;
} else {
    if (scenario.genderValue.entity !== "Prefer not to say") {
        scenario.gender = scenario.genderValue.entity.toLowerCase();
    }
}
// age
if (scenario.luis.age != null) {
    scenario.age = scenario.luis.age;
} else {
    scenario.age = scenario.ageValue;
}
// condition
if (scenario.luis.condition != null) {
    scenario.condition = scenario.luis.condition;
} else {
    scenario.condition = scenario.conditionValue;
}
// location
if (scenario.luis.location != null) {
    scenario.searchLocationCity = scenario.luis.location.city;
    scenario.searchLocationState = scenario.luis.location.country;
} else {
    scenario.searchLocationCity = scenario.cityValue != null ? scenario.cityValue : null;
    scenario.searchLocationState = scenario.stateValue != null ? scenario.stateValue : null;
}

// initialize profile
var profile = {};
profile.gender = scenario.gender;
profile.age = scenario.age;
profile.location = scenario.location;
profile.searchLocationCity = scenario.searchLocationCity;
profile.searchLocationState = scenario.searchLocationState;
profile.distance = scenario.distance;
profile.condition = scenario.condition;
profile.askedCodes = [];
scenario.profile = profile;

// initialize matchingRequest
var matchingRequest = {};
matchingRequest.id = new Date().getTime().toString();
matchingRequest.profile = scenario.profile;
scenario.matchingRequest = matchingRequest;

scenario.trials = scenario.matchingResponse.trials;
scenario.trialsCountPrev = scenario.trialsCount;
scenario.trialsCount = scenario.trials.length;

scenario.card = {
  "$schema": "http://adaptivecards.io/schemas/adaptive-card.json",
  "type": "AdaptiveCard",
  "version": "0.5",
  "body": scenario.trials.map(trial => {
      return {
        "type": "Container",
        "style": "emphasis",
        "spacing": "none",
        "separator": false,
        "items": [{
              "type": "TextBlock",
              "text": "**"+trial.nctId+"** - [" + trial.title + "](https://clinicaltrials.gov/ct2/show/" + trial.nctId + ")",
              "wrap": true,
              "size": "default",
              "weight": "bolder",
              "color": "dark"
            }
        ]
      };
  })
};

var messageText = scenario.messageText.toLowerCase();

scenario.questions = {};
scenario.questions.genderQuestion = "Please specify the patient's sex:";
scenario.questions.ageQuestion = "How old is the patient (in years)?";
scenario.questions.conditionQuestion = "What is the patient's condition?";
scenario.questions.locationQuestion = "Where would the patient like to search for trials?";
scenario.questions.stateQuestion = "Please enter state:";
scenario.questions.cityQuestion = "Please enter city:";

var trialIds = scenario.trials.map(trial => trial.nctId);

scenario.criteriaRequest = {
    trialIds,
    profile: scenario.profile
};

// keeping track for total questions
scenario.totalQuestionsAsked++;

var criterion = scenario.criteriaResponse.criteria[scenario.questionIndex];
scenario.questionArgs = {};
scenario.questionArgs.question = criterion;

scenario.trials = scenario.disqualifyResponse.trials;
scenario.trialsCountPrev = scenario.trialsCount;
scenario.trialsCount = scenario.trials.length;

// if has question by entity type
if (scenario.languageJson.entityTypes[scenario.question.ayalonEntityType] != null) {
    scenario.questionText = scenario.languageJson.entityTypes[scenario.question.ayalonEntityType].question;
} else if(scenario.languageJson.concepts[scenario.question.umlsConceptId] != null) {
    // has question or points to concepet with question
    if (scenario.languageJson.concepts[scenario.question.umlsConceptId].question != null) {
        scenario.questionText = scenario.languageJson.concepts[scenario.question.umlsConceptId].question;
    } else {
        var concept = scenario.languageJson.concepts[scenario.question.umlsConceptId];
        scenario.questionText = scenario.languageJson.concepts[concept.mappedTo].question;
    }
} else {
    // got concept id without a valid question mapped to it
    scenario.questionText = "?"
}

scenario.questionText = scenario.questionText.replace("%p1%", scenario.question.ayalonEntityText);

if (scenario.response.entity === "Yes") {
    scenario.response = "true";
} else if (scenario.response.entity === "No") {
    scenario.response = "false";
} else {
    scenario.response = null;
}

var regex = /[D,d]on[']?t [K,k]now|[N,n]ot [S,s]ure/;
if (scenario.response && scenario.response.match(regex)) {
    scenario.response = null;
}
